import img  from "../error.png";

const ErrorMassage = (props) => {
    return (
        <>  
            const = {posts} =this.props
            <img src={img} alt="error"></img>
            <p>sheamowmet json serveri,
                {posts?"postebi ver itvirteba":"suratebi ver itvirteba"}
            </p>
        </>
    )
}

export default ErrorMassage ;
